(7, 'X15 TWS Wireless Earphone 5.3 Bluetooth Headphone Low Latency Earbud Sport Gaming Headset Gamer with Mic', 'x15-tws-wireless-earphone-5.3-bluetooth-headphone-low-latency-earbud-sport-gaming-headset-gamer-with-mic-7', 12, 0, NULL, NULL, 'P0007', 500, 999, 670, 400, NULL, NULL, '<p><span style=\"font-size: 16px; color: rgb(34, 34, 34); font-family: &quot;TT Norms Pro&quot;, &quot;Open Sans&quot;, Roboto, Arial, Helvetica, sans-serif, SimSun;\"><span style=\"font-weight: 700; background-color: rgb(255, 255, 0);\">Wireless &amp; bluetooth-compatible:</span>&nbsp;These kinds of earbuds are designed with bluetooth-compatible V5.0 technology, which ensures a stable connection and clear sound, you can use them without worries.</span><br style=\"font-size: 16px; -webkit-tap-highlight-color: transparent; outline: 0px; color: rgb(34, 34, 34); font-family: &quot;TT Norms Pro&quot;, &quot;Open Sans&quot;, Roboto, Arial, Helvetica, sans-serif, SimSun;\"><span style=\"font-size: 16px; color: rgb(34, 34, 34); font-family: &quot;TT Norms Pro&quot;, &quot;Open Sans&quot;, Roboto, Arial, Helvetica, sans-serif, SimSun;\"><span style=\"background-color: rgb(255, 255, 0);\"><span style=\"font-weight: 700;\">Waterproof &amp; rechargeable:</span></span>&nbsp;These waterproof headphones are designed with built-in battery, which can be used for a long time after fully charged, enough to meet your daily needs.</span><br style=\"font-size: 16px; -webkit-tap-highlight-color: transparent; outline: 0px; color: rgb(34, 34, 34); font-family: &quot;TT Norms Pro&quot;, &quot;Open Sans&quot;, Roboto, Arial, Helvetica, sans-serif, SimSun;\"><span style=\"font-size: 16px; color: rgb(34, 34, 34); font-family: &quot;TT Norms Pro&quot;, &quot;Open Sans&quot;, Roboto, Arial, Helvetica, sans-serif, SimSun;\"><span style=\"font-weight: 700; background-color: rgb(255, 255, 0);\">Low latency &amp; touch control:</span>&nbsp;These headphones work with 65ms low latency and you can control them by touching, c